import React from "react";
import "./style.css";

const People = () => {
  return (
    <div className="people">
      <div className="navbar">
        <nav class="navbar navbar-light bg-light">
          <div class="container-fluid"></div>
        </nav>
      </div>
    </div>
  );
};

export default People;
